import "./App.css";

function App() {
  const users = [
    { name: "Ahmed", age: 20 },
    { name: "Ruwaydah", age: 14 },
    { name: "Rayana", age: 14 },
  ];

  return (
    <div className="App">
      {users.map((user, key) => {
        return (
          <>
           <h1 key={key}>{user.name} {user.age}</h1> 
          </>
        );
      })}
    </div>
  );
}
